// ---- inputs de outros nós
const tokendocumento  = $('Detalhar documentos').first().json.token;
const tokenassinante  = $('Edit Fields').first().json['token-assinante'];
const email           = $('Se nao é adm').first().json.signers?.[0]?.email || "";

// ---- util: sanitiza e divide número em country/number
function splitPhone(raw) {
  const digitsRaw = String(raw || '').replace(/\D+/g, ''); // só dígitos
  if (!digitsRaw) return { phone_country: '', phone_number: '' };

  // Casos comuns
  if (digitsRaw.startsWith('55') && digitsRaw.length >= 12) {
    return { phone_country: '55', phone_number: digitsRaw.slice(2) };
  }
  if (digitsRaw.startsWith('1') && digitsRaw.length === 11) { // EUA/Canadá: 1 + 10
    return { phone_country: '1', phone_number: digitsRaw.slice(1) };
  }

  // Genérico: se veio com DDI (comprimento > 11), assume DDI com 2 dígitos
  if (digitsRaw.length > 11) {
    return { phone_country: digitsRaw.slice(0, 2), phone_number: digitsRaw.slice(2) };
  }

  // Se não veio DDI, assume BR por padrão
  return { phone_country: '55', phone_number: digitsRaw };
}

// ---- busca no input o contato pelo email e extrai telefone
let numero = '';
if (email) {
  const alvo = email.trim().toLowerCase();
  for (const it of items) {
    const c = it.json?.contato;
    if (!c) continue;
    const e = String(c.email || '').trim().toLowerCase();
    if (e === alvo) {
      numero = String(c.telefone ?? '').trim();
      break;
    }
  }
}

const { phone_country, phone_number } = splitPhone(numero);

// ---- saída única com os campos necessários
return [{
  json: {
    tokendocumento,
    tokenassinante,
    email,
    phone_country,
    phone_number
  }
}];

